parts.text:
[
  {
    "id": "main_application_window",
    "type": "window",
    "text": "Sem título 1 — LibreOffice Writer",
    "state": "active",
    "region": "background",
    "meta": {
      "title_bar_text": "Sem título 1 — LibreOffice Writer"
    }
  },
  {
    "id": "menu_bar",
    "type": "menu_bar",
    "region": "top-bar",
    "meta": {
      "items": [
        "Arquivo",
        "Editar",
        "Exibir",
        "Inserir",
        "Formatar",
        "Estilos",
        "Tabela",
        "Formulário",
        "Ferramentas",
        "Janela",
        "Ajuda"
      ]
    }
  },
  {
    "id": "toolbar_paragraph_style",
    "type": "dropdown",
    "text": "Estilo de parágrafo Padrão",
    "region": "toolbar",
    "actions": ["onClick"]
  },
  {
    "id": "toolbar_font_family",
    "type": "dropdown",
    "text": "Arial",
    "region": "toolbar",
    "actions": ["onClick"]
  },
  {
    "id": "toolbar_font_size",
    "type": "dropdown",
    "text": "12 pt",
    "region": "toolbar",
    "actions": ["onClick"]
  },
  {
    "id": "status_bar",
    "type": "status_bar",
    "region": "footer",
    "meta": {
      "items": [
        "Página 1 de 1",
        "0 palavra",
        "0 caractere",
        "Estilo de página Padrão",
        "Português (Brasil)"
      ]
    }
  },
  {
    "id": "modal_insert_table",
    "type": "modal",
    "text": "Inserir tabela",
    "state": "active",
    "region": "center",
    "meta": {
      "title": "Inserir tabela"
    }
  },
  {
    "id": "modal_close_button",
    "type": "icon_button",
    "text": "Fechar",
    "region": "modal_header",
    "actions": ["onClick"],
    "meta": {
      "icon": "close"
    }
  },
  {
    "id": "modal_maximize_button",
    "type": "icon_button",
    "text": "Maximizar",
    "region": "modal_header",
    "actions": ["onClick"],
    "meta": {
      "icon": "maximize"
    }
  },
  {
    "id": "modal_minimize_button",
    "type": "icon_button",
    "text": "Minimizar",
    "region": "modal_header",
    "actions": ["onClick"],
    "meta": {
      "icon": "minimize"
    }
  },
  {
    "id": "section_general",
    "type": "section_header",
    "text": "Geral",
    "region": "modal_content"
  },
  {
    "id": "label_table_name",
    "type": "label",
    "text": "Nome:",
    "region": "modal_content",
    "meta": {
      "for": "input_table_name"
    }
  },
  {
    "id": "input_table_name",
    "type": "input",
    "text": "Tabela1",
    "state": "enabled",
    "region": "modal_content",
    "actions": ["onChange", "onFocus", "onBlur"],
    "meta": {
      "input_type": "text"
    }
  },
  {
    "id": "label_columns",
    "type": "label",
    "text": "Colunas:",
    "region": "modal_content",
    "meta": {
      "for": "input_columns"
    }
  },
  {
    "id": "input_columns",
    "type": "input_number_spinner",
    "text": "4",
    "state": "enabled",
    "region": "modal_content",
    "actions": ["onChange", "onIncrement", "onDecrement", "onFocus", "onBlur"],
    "meta": {
      "input_type": "number"
    }
  },
  {
    "id": "label_rows",
    "type": "label",
    "text": "Linhas:",
    "region": "modal_content",
    "meta": {
      "for": "input_rows"
    }
  },
  {
    "id": "input_rows",
    "type": "input_number_spinner",
    "text": "4",
    "state": "focused",
    "region": "modal_content",
    "actions": ["onChange", "onIncrement", "onDecrement", "onFocus", "onBlur"],
    "meta": {
      "input_type": "number"
    }
  },
  {
    "id": "section_options",
    "type": "section_header",
    "text": "Opções",
    "region": "modal_content"
  },
  {
    "id": "checkbox_title",
    "type": "checkbox",
    "text": "Título",
    "state": "unchecked",
    "region": "modal_content",
    "actions": ["onClick"]
  },
  {
    "id": "checkbox_repeat_title_rows",
    "type": "checkbox",
    "text": "Repetir linhas de título nas novas páginas",
    "state": "checked",
    "region": "modal_content",
    "actions": ["onClick"]
  },
  {
    "id": "label_title_rows",
    "type": "label",
    "text": "Linhas de título:",
    "state": "disabled",
    "region": "modal_content",
    "meta": {
      "for": "input_title_rows"
    }
  },
  {
    "id": "input_title_rows",
    "type": "input_number_spinner",
    "text": "1",
    "state": "disabled",
    "region": "modal_content",
    "actions": []
  },
  {
    "id": "checkbox_do_not_split_table",
    "type": "checkbox",
    "text": "Não dividir tabela entre páginas",
    "state": "unchecked",
    "region": "modal_content",
    "actions": ["onClick"]
  },
  {
    "id": "section_styles",
    "type": "section_header",
    "text": "Estilos",
    "region": "modal_content"
  },
  {
    "id": "listbox_styles",
    "type": "listbox",
    "region": "modal_content",
    "actions": ["onChange"],
    "meta": {
      "items": [
        {"text": "Nenhum", "state": "selected"},
        {"text": "Estilo de tabela Padrão", "state": "unselected"},
        {"text": "Acadêmico", "state": "unselected"},
        {"text": "Mundo azul", "state": "unselected"},
        {"text": "Mundo verde", "state": "unselected"},
        {"text": "Mundo escarlate", "state": "unselected"},
        {"text": "Mundo da alvorada", "state": "unselected"},
        {"text": "Elegante", "state": "unselected"}
      ]
    }
  },
  {
    "id": "table_preview",
    "type": "table",
    "region": "modal_content",
    "meta": {
      "headers": ["", "Jan", "Fev", "Mar", "Soma"],
      "rows": [
        ["Norte", "6", "7", "8", "21"],
        ["Meio", "11", "12", "13", "36"],
        ["Sul", "16", "17", "18", "51"],
        ["Soma", "33", "36", "39", "108"]
      ]
    }
  },
  {
    "id": "button_help",
    "type": "button",
    "text": "Ajuda",
    "state": "enabled",
    "region": "modal_footer",
    "actions": ["onClick"]
  },
  {
    "id": "button_insert",
    "type": "button",
    "text": "Inserir",
    "state": "enabled",
    "region": "modal_footer",
    "actions": ["onClick"],
    "meta": {
      "is_primary": true
    }
  },
  {
    "id": "button_cancel",
    "type": "button",
    "text": "Cancelar",
    "state": "enabled",
    "region": "modal_footer",
    "actions": ["onClick"]
  }
]
